 набор модулей обучения, составленный в зависимости от Ваших целей, занятости, уровня знаний и профессиональных интересов.	Вы используете передовые технологии и материалы, разработанные ведущими издательствами мира специально для онлайн обучения.	Профессионал экстра класса будет контролировать Вашу успеваемость, вносить корректировки в программу и давать рекомендации Вам и преподавателю.	Обучение состоит из этапов, успешное прохождение которых гарантирует получение именного сертификата.\r\n	Достижение поставленных целей	Высокое качество обучения	Индивидуальный подход	Вы всегда знаете, когда достигните желаемых результатов. Перед началом обучения мы согласовываем цели и промежуточные этапы, которые будут достигнуты в рамках программы.	Вы используете современные обучающие материалы и технологии, разработанные специально для онлайн обучения. А закрепленный за Вами методист сделает обучение максимально эффективным.\r\n	Все настраивается под Вас: программа, расписание, длительность занятий и преподаватель. Программа обучения меняется в зависимости от Вашей успеваемости.\r\n\r\n		Разговорный
