1	«Язык сломать можно!» — выражения о частях тела	<p>Для большинства современных государств открытые военные конфликты стали бессмысленными, что отражает статистика. Согласно выкладкам канадского учёного Стивена Пинкера, от войн между племенами в древности погибало в 9 раз больше людей, чем от войн в XX веке, а в Средневековье жертвами насилия становились в 30 раз больше человек, чем в последние годы. По оценке ООН, сейчас в активной стадии находятся 11 крупных конфликтов (с более чем 1 тыс. погибших за год). Это не так много, если сравнивать с предыдущими эпохами. Другое дело, что участились так называемые информационные войны. Look At Me разобрался, что они собой представляют и как не стать их жертвой.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div class="qq" style="border:1px solid black;">\r\n<table align="center" border="3" cellpadding="1" cellspacing="1" style="height:126px; width:605px">\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td style="text-align:center">\r\n\t\t\t<p><strong><span style="font-size:24px">В широком смысле информационная война включает в себя</span></strong></p>\r\n\r\n\t\t\t<p>&nbsp;</p>\r\n\r\n\t\t\t<p>манипулирование информацией и средствами коммуникации, сбор данных, пропаганду, саботаж логистики и электроники, слежку и другие меры.</p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n\r\n<div>\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table align="center" border="1" cellpadding="50" cellspacing="50" class="table" style="border-spacing:10px; width:615px">\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<div style="width:100px">\r\n\t\t\t<hr />\r\n\t\t\t<p>&nbsp;</p>\r\n\t\t\t</div>\r\n\t\t\t</td>\r\n\t\t\t<td>\r\n\t\t\t<div style="width:100px;padding-left:20px">\r\n\t\t\t<hr />\r\n\t\t\t<p>&nbsp;</p>\r\n\t\t\t</div>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>Для этого лучше всего подходят средства массовой информации, прежде всего &mdash; телевидение. Оно по-прежнему создаёт эффект присутствия и соучастия успешнее, чем интернет в целом и социальные сети в частности.</td>\r\n\t\t\t<td>\r\n\t\t\t<div style="padding-left:20px">Как и рекламные кампании, информационные войны отличаются друг от друга по степени воздействия (ровные, нарастающие и нисходящие), направленности (целевые и общественные) и охвату (региональные, национальные и международные).</div>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n\r\n<div class="note__title">&nbsp;</div>\r\n\r\n<div class="note__title"><span style="font-size:22px">Манипулируют всегда скрытно</span></div>\r\n\r\n<div class="note__title">&nbsp;</div>\r\n\r\n<div class="note__title">\r\n<div class="note__content">\r\n<p>Для большинства современных государств открытые военные конфликты стали бессмысленными, что отражает статистика. Согласно выкладкам канадского учёного Стивена Пинкера, от войн между племенами в древности погибало в 9 раз больше людей, чем от войн в XX веке, а в Средневековье жертвами насилия становились в 30 раз больше человек, чем в последние годы. По оценке ООН, сейчас в активной стадии находятся 11 крупных конфликтов (с более чем 1 тыс. погибших за год). Это не так много, если сравнивать с предыдущими эпохами. Другое дело, что участились так называемые информационные войны. Look At Me разобрался, что они собой представляют и как не стать их жертвой.</p>\r\n</div>\r\n</div>\r\n</div>\r\n	Глеб Давыдов	images.jpg	2014-09-03 12:33:08.633485	2014-11-09 09:15:02.072796	76	Мне действительно очень много дали первые полтора месяца занятий. И это при условии, что я, в силу своей занятости, не могу готовить домашние задания.	ava_mini1.jpg	f	f	1
11	Как получить максимальную пользу от занятий	<p><strong><span style="font-size:18px"><span style="font-family:trebuchet ms,helvetica,sans-serif">Старайтесь не использовать русский язык на занятиях.</span></span></strong> <span style="font-size:16px"><span style="font-family:trebuchet ms,helvetica,sans-serif">Старайтесь хоть на 2 часа 2 раза в неделю подвергать себя такому серьезному испытанию, представляя что русский язык никто вокруг не понимает.</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><span style="font-family:trebuchet ms,helvetica,sans-serif"><span style="font-size:18px">Записывайте устоявшиеся выражения.</span></span></strong> <span style="font-size:16px"><span style="font-family:trebuchet ms,helvetica,sans-serif">Всегда лучше запоминать не слово в отдельности, а фразу, в которой он присутствует. Если Вы будете находить время чтобы делить набор Ваших карточек на две части &ndash; знакомые и незнакомые фразы, то очень скоро заметите что вторая часть с незнакомыми фразами быстро уменьшится.</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><span style="font-family:trebuchet ms,helvetica,sans-serif"><span style="font-size:18px">Слушайте и смотрите на языке оригинала</span></span>.</strong><span style="background-color:transparent; color:rgb(0, 0, 0); font-family:trebuchet ms,helvetica,sans-serif; font-size:16px"> Слушайте новости по спутниковым каналам, смотрите ролики на </span><a href="http://www.youtube.com/" style="font-family: 'trebuchet ms', helvetica, sans-serif; font-size: 16px; line-height: 1.6; text-decoration: none;"><span style="background-color:transparent; color:rgb(0, 0, 0)">You Tube</span></a><span style="background-color:transparent; color:rgb(0, 0, 0); font-family:trebuchet ms,helvetica,sans-serif; font-size:16px">. Со временем Вы все чаще начнете замечать как те словосочетания и фразы c которыми Вы познакомились на уроках &ldquo;работают&rdquo; в разных контекстах.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><span style="font-family:trebuchet ms,helvetica,sans-serif"><span style="font-size:18px">Купите англо-английский словарь</span></span>.</strong><span style="background-color:transparent; color:rgb(0, 0, 0); font-family:trebuchet ms,helvetica,sans-serif; font-size:16px"> Несмотря на то, что поначалу Вы будете тратить намного больше времени на поиск и понимание нужного Вам слова или выражения &mdash; прорыв Вас впечатлит: работа с подобными словарями помогает быстро пополнить словарный запас.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div><span style="font-size:16px"><span style="font-family:trebuchet ms,helvetica,sans-serif"><span style="background-color:transparent; color:rgb(0, 0, 0)">Мы искренне желаем Вам успехов! </span></span></span></div>\r\n	Polina Dubershtein	28916315c8d33cb0820a2610a42c8c7a.jpg	2014-11-09 09:28:52.451585	2014-12-01 06:55:54.082301	98	Методист команды TreeWords	e9b6ddf423959e2942ea84029ef921a6.jpg	t	t	2
3	Прививка от исламизма! Россия — крупнейший после США поставщик вооружений и военной техники в Ирак	<p>Россия &mdash; крупнейший после США поставщик вооружений и&nbsp;военной техники в&nbsp;Ирак. За&nbsp;последние несколько лет раздираемое междуусобицами ближневосточное государство закупилось у&nbsp;&laquo;Рособоронэкспорта&raquo; более чем на&nbsp;пять миллиардов долларов. В&nbsp;конце августа Багдад получил из&nbsp;Москвы очередную партию ударных вертолетов Ми-28НЭ &laquo;Ночной охотник&raquo;. Местные военные планируют бросить их&nbsp;на борьбу с&nbsp;&laquo;Исламским государством&raquo; и&nbsp;поддержку населения в&nbsp;удаленных районах страны. &laquo;Лента.ру&raquo; решила вспомнить, какая еще техника с&nbsp;клеймом &laquo;Сделано в&nbsp;России&raquo; может пригодиться Ираку для подавления сепаратистов.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="" src="http://icdn.lenta.ru/images/2014/09/03/13/20140903132446575/preview_7bed3244f46564bd18ecbf5f05dc9505.jpg" style="height:407px; width:609px" /></p>\r\n	Андрей	room3-375x249.jpg	2014-09-03 12:56:17.649402	2014-11-09 09:14:58.772345	94	Забыл что что хотелнаписать	img2.jpg	t	f	1
2	Яценюк предложил России два варианта цены на газ	<p>Премьер-министр Украины Арсений Яценюк заявил о наличии у Киева двух вариантов цены на газ, поставляемый в страну из России, сообщает <a class="source" href="http://www.ria.ru/" target="_blank">РИА Новости</a>. По первому из них, предлагается установить цену на уровне 300&nbsp;долларов за тысячу кубометров в &laquo;низкий&raquo; сезон, то есть теплое время года, и 380&nbsp;долларов зимой.</p>\r\n\r\n<p>Второй вариант предполагает установить цену в привязке к спотовому рынку газа в Европе. Ранее такой порядок установления цены предлагало министерство энергетики страны. Он означает, что цена должна быть равна стоимости газа на европейских хабах минус расходы на транспортировку от границы РФ.</p>\r\n\r\n<p>Яценюк также заявил, что Украине необходимо закупать у РФ 25&nbsp;миллиардов кубометров газа в год. Он добавил, что страна намерена приобрести у европейских государств около 15&nbsp;миллиардов кубометров, что компенсирует закупки из России на 60&nbsp;процентов. При этом Киев располагает примерно 16&nbsp;миллиардами кубометров в своих подземных хранилищах.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="" src="http://icdn.lenta.ru/images/2014/09/03/14/20140903145949563/pic_6c4940081fc4e91d4e19e4284cdb7fbc.jpg" style="height:280px; width:420px" /></p>\r\n	Галина Тимченко	reservation1-375x249.jpg	2014-09-03 12:50:06.774973	2014-11-11 22:54:28.510747	40	Ох уж этот Яценюк	img1.jpg	f	f	1
9	5 мифов об изучении английского языка	<p dir="ltr"><span style="font-family:trebuchet ms,helvetica,sans-serif"><span style="background-color:transparent; color:rgb(0, 0, 0); font-size:19px">Свободное владение английским языком также важно, как и умение работать на компьютере или наличие мобильной связи. Как известно, спрос рождает предложение и количество языковых школ, методик преподавания, иногда граничащих с шаманством, неукоснительно растет. Чтобы не &laquo;попасться на удочку&raquo; и правильно расставить приоритеты в процессе изучения языка, мы расскажем о главных мифах в изучении английского.</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h1 dir="ltr"><span style="font-family:trebuchet ms,helvetica,sans-serif"><strong>Миф 1. Без &laquo;погружения&raquo; в англоязычную среду нельзя достигнуть высокого уровня владения языком</strong></span></h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p dir="ltr"><span style="font-family:trebuchet ms,helvetica,sans-serif"><span style="background-color:transparent; color:rgb(0, 0, 0); font-size:19px">Многие считают, что для быстрого достижения высокого уровня английского необходимо выехать в англоязычную страну на пару месяцев, а лучше на год.</span></span></p>\r\n\r\n<p dir="ltr"><span style="font-family:trebuchet ms,helvetica,sans-serif"><span style="background-color:transparent; color:rgb(0, 0, 0); font-size:19px">Существуют исследования и практические реализации детского би- и даже трилингвизма, когда они практикуют использование родного языка одного из родителей только в семье, в среде другого языка.</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p dir="ltr"><span style="font-family:trebuchet ms,helvetica,sans-serif"><span style="background-color:transparent; color:rgb(0, 0, 0); font-size:19px">Процесс изучения иностранного языка можно сравнить с тем, как люди учатся плавать. Многие решительные и бесстрашные педагоги учат плавать методом шока: человека толкают в воду и следят только за тем, чтобы тот не утонул. Если это ученик с крепкой нервной системой, то ничего страшного с ним не случится, и он начнет плавать довольно скоро. Правда, он будет плавать &laquo;по-собачьи&raquo; и переучить его будет крайне сложно.</span></span></p>\r\n\r\n<p dir="ltr"><span style="font-family:trebuchet ms,helvetica,sans-serif"><span style="background-color:transparent; color:rgb(0, 0, 0); font-size:19px">В то же время можно учиться плавать и по-другому: под руководством инструктора выполнять разнообразные упражнения в воздухе, учиться дышать, загребать и т. д., не входя в воду. И, таким образом, приобрести хорошую технику.</span></span></p>\r\n\r\n<p dir="ltr"><span style="font-family:trebuchet ms,helvetica,sans-serif"><span style="background-color:transparent; color:rgb(0, 0, 0); font-size:19px">То же самое происходит и с изучением языка. От ошибок, приобретенных и закрепленных (так как их никто не исправлял) очень трудно избавиться, учащиеся надолго задерживаются на уровне Intermediate, им надо затратить намного больше усилий для перехода на более высокий уровень владения, чем тем, кого действительно учили а не &laquo;погружали&raquo;.</span></span></p>\r\n\r\n<p><br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<h1 dir="ltr"><span style="font-family:trebuchet ms,helvetica,sans-serif"><strong>Миф 2. Существует &ldquo;секретная методика&rdquo; изучения английского языка</strong></span></h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p dir="ltr"><span style="font-family:trebuchet ms,helvetica,sans-serif"><span style="background-color:transparent; color:rgb(0, 0, 0); font-size:19px">Изучение языка можно сравнить с процессом лечения у врача. Большинство из нас не пойдет лечиться к доктору-изобретателю, убеждающему нас что только его метод работает эффективно. Скорее, мы пойдем к доктору, получившему хорошее образование, который знает обо всех достижениях современной науки, о плюсах и минусах различных методик лечения.</span></span></p>\r\n\r\n<p dir="ltr"><span style="font-family:trebuchet ms,helvetica,sans-serif"><span style="background-color:transparent; color:rgb(0, 0, 0); font-size:19px">Также и с английским языком.</span></span></p>\r\n\r\n<p><br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<h1 dir="ltr"><span style="font-family:trebuchet ms,helvetica,sans-serif"><strong>Миф 3. Есть люди неспособные к изучению английского языка</strong></span></h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p dir="ltr"><span style="font-family:trebuchet ms,helvetica,sans-serif"><span style="background-color:transparent; color:rgb(0, 0, 0); font-size:19px">Обычно так считает тот, кого в школе или институте учили языку как филолога, нагружая большим количеством подробностей, более важных для профессионального лингвиста, чем для пользователя языка. А большинству учащихся язык нужен именно на уровне пользователя &mdash; для общения, переписки, чтения профессиональной литературы.</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2 dir="ltr"><span style="font-family:trebuchet ms,helvetica,sans-serif"><strong>Нет неспособных, есть неправильные подходы. </strong></span></h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p dir="ltr"><span style="font-family:trebuchet ms,helvetica,sans-serif"><span style="background-color:transparent; color:rgb(0, 0, 0); font-size:19px">Более того, профессионал своего дела обязательно учтет не только академические аспекты изучения, но и личностные особенности ученика. Например, он будет учитывать, какая память лучше всего работает у учащегося: зрительная, слуховая или моторная, и будет использовать именно ее при построении занятий.</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h1 dir="ltr"><span style="font-family:trebuchet ms,helvetica,sans-serif"><strong>Миф 4. Можно выучить язык без домашних заданий.</strong></span></h1>\r\n\r\n<p><span style="background-color:transparent; color:rgb(0, 0, 0); font-family:trebuchet ms,helvetica,sans-serif; font-size:19px">Регулярное и качественное выполнение домашнего задания необходимо, хоть это и не самая захватывающая часть процесса обучения. Приходилось ли Вам встречать учащихся музыкальных школ, которые наслаждаются процессом разучивания гамм? Несмотря на это, они понимают, что без этого невозможно обойтись.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h1 dir="ltr"><span style="font-family:trebuchet ms,helvetica,sans-serif"><strong>Миф 5. После школы начинать изучать языки уже поздно.</strong></span></h1>\r\n\r\n<p><span style="background-color:transparent; color:rgb(0, 0, 0); font-family:trebuchet ms,helvetica,sans-serif; font-size:19px">Как раз наоборот. Когда человек начинает сам зарабатывать деньги, то он ценит свое время и усилия, и, таким образом, имеет сильную мотивацию. Благодаря высокой мотивации процесс изучения языка протекает наиболее успешно.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p dir="ltr"><span style="font-family:trebuchet ms,helvetica,sans-serif"><span style="background-color:transparent; color:rgb(0, 0, 0); font-size:19px">Многие полиглоты овладели иностранными языками именно в зрелом возрасте. Знание и изучение языков не только не мешает, но и способствует развитию памяти, тормозит процессы старения и помогает бороться с ухудшением памяти в более зрелом возрасте.</span></span></p>\r\n\r\n<div>&nbsp;</div>\r\n	Polina Dubershtein	d28144031a93da56a82a0c4bca0b2f00.jpg	2014-11-09 09:17:22.338079	2014-12-04 12:29:57.372425	40	Методист команды TreeWords	ae5722fc0c46f5e5c0a283fa4838e782.jpg	f	t	2
