4	Почему трава зеленая, а программисты крутые	<p><span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">Я люблю находить на новостных ресурсах статьи о том, что программисты получают очень много денег. Я сразу пролистываю их до комментариев и с теплом в душе читаю гневные отзывы о том, что программисты ничего не делают и не заслуживают таких денег. Но после прочтения возникает мысль: знают ли они, кто такие программисты? Или они исходят в своих суждениях из неверного знания, даже не подозревая об этом. Например, мало кто знает, почему трава зеленая. Подумайте об этом. Следует ли из ваших объяснений зелености травы именно зеленый цвет?</span><br />\r\n<a name="habracut"></a><br />\r\n&nbsp;</p>\r\n\r\n<h4>Почему трава зеленая</h4>\r\n\r\n<p><br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">Вот представьте, есть у вас маленький ребенок (а у некоторых он действительно есть). И спрашивает у вас ребенок типичный детский вопрос &laquo;Почему трава зеленая&raquo;. У вас есть 4 варианта ответа:</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">1. &laquo;Потому что. У тебя мороженка уже капает&raquo;</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">2. На скорую руку придуманное объяснение (автоматически решает проблему с вопросом про голубое небо). Шаблон для ответов по этому принципу:</span><br />\r\n<br />\r\n<em>Природа так удачно создала наш мир, чтобы все в нем было хорошо и приятно. Поэтому небо голубое, солнце желтое, трава зеленая</em><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">3. Хорошее понятное объяснение с точки зрения науки в понятных ребенку терминах.</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">4. Вывалить на ребенка кучу научной чепухи, чтобы он сам выбрал нужное&nbsp;</span><s>и погуглил недостающее</s><span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">.</span><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">Наверное, лучший все-таки вариант 3. Но есть проблема. Вы</span><em>&nbsp;не знаете</em><span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">&nbsp;вариант 3.</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">Ах вы знаете вариант 3? Давайте послушаем:</span><br />\r\n<br />\r\n<img src="http://habrastorage.org/files/86d/c41/a38/86dc41a38d41411ea751a2c5460decb3.png" style="border:0px; color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px; line-height:20.7999992370605px; margin:0px; max-width:100%; outline:0px; padding:0px; vertical-align:middle" /><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">Отлично. А почему хлорофилл зеленый?</span><br />\r\n<br />\r\n<img src="http://habrastorage.org/files/081/09c/a93/08109ca9356545b9823234d7459a9860.png" style="border:0px; color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px; line-height:20.7999992370605px; margin:0px; max-width:100%; outline:0px; padding:0px; vertical-align:middle" /><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">Здорово. Этим ответом ребенок точно удовлетворится.</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">Ответ&nbsp;</span><em>&laquo;Потому что в ней содержится вещество хлорофилл, которое зеленое&raquo;</em><span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">&nbsp;не является ложью и дает ребенку необходимый ответ. Но в нем нет&nbsp;</span><em>нужного</em><span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">&nbsp;знания. То, что хлорофилл поглощает все, кроме зеленого цвета &mdash; это определение зеленого цвета. С такой точки зрения, зеленый кубик зеленый только потому, что отражает зеленый цвет. А не потому, что его покрасили зеленой краской.</span><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">Давайте сначала изучим вариант 4, а потом просто упростим его до уровня понимания ребенка. Итак, почему трава зеленая?</span><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">Хлорофи́лл (от греч. &chi;&lambda;&omega;&rho;ό&sigmaf;, &laquo;зелёный&raquo; и &phi;ύ&lambda;&lambda;&omicron;&nu;, &laquo;лист&raquo;) &mdash; зелёный пигмент, обусловливающий окраску хлоропластов растений в зелёный цвет. При его участии осуществляется процесс фотосинтеза. По химическому строению хлорофиллы &mdash; магниевые комплексы различных тетрапирролов. Хлорофиллы имеют порфириновое строение и структурно близки гему. (</span><em>Wikipedia</em><span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">)</span><br />\r\n<br />\r\n<img src="http://habrastorage.org/files/c6d/26e/70f/c6d26e70feb14f71ba58badc39659cab.jpg" style="border:0px; color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px; line-height:20.7999992370605px; margin:0px; max-width:100%; outline:0px; padding:0px; vertical-align:middle" /><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">А теперь давайте по-детскому. Усадите вашего ребенка на стульчик,&nbsp;</span><s>привяжите его</s><span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">&nbsp;и начинайте объяснять.</span><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">Итак, трава зеленая, потому что в ней содержится хлорофилл. Хлорофилл нужен, чтобы обеспечивать процесс фотосинтеза и превращать углекислый газ в кислород, получая при этом энергию для жизни растения. И именно с процессом фотосинтеза связан зеленый цвет хлорофилла.</span><br />\r\n<br />\r\n<img src="http://habrastorage.org/files/96b/3b3/085/96b3b308510c4dbaaed138267b0c0044.png" style="border:0px; color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px; line-height:20.7999992370605px; margin:0px; max-width:100%; outline:0px; padding:0px; vertical-align:middle" /><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">Белый свет является смесью всех цветов видимой части спектра. Каждому цвету соответствует своя длина световой волны. Энергия обратно пропорциональна длине волны: чем длина больше, тем энергия меньше. Этим можно объяснить, почему хлорофилл поглощает синие цвета, ведь они обладают самой большой энергией.</span><br />\r\n<br />\r\n<img src="http://habrastorage.org/files/609/b09/be1/609b09be133e49038e6daf90769a4a97.png" style="border:0px; color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px; line-height:20.7999992370605px; margin:0px; max-width:100%; outline:0px; padding:0px; vertical-align:middle" /><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">Поглощение же красных цветов зависит от другой характеристики светового излучения &mdash; числа фотонов на единицу энергии. Хлорофиллы активизируются не энергией, а фотонами. То есть чем фотонов больше, тем активнее происходит реакция фотосинтеза. Количество фотонов наоборот, возрастает с увеличением длины волны.</span><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">Объединив энергию и количество фотонов, мы получим 5 разных областей:</span><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">1. Фотонов настолько мало, что даже много энергии у каждого не позволяет протекать реакции фотосинтеза;</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">2. Число фотонов увеличивается, и теперь их достаточно для реакции, несмотря на то, что энергия немного снизилась;</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">3. Энергии стало меньше, а фотонов еще недостаточно, и реакция вновь под угрозой;</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">4. Фотонов много, они непрерывно бомбардируют лист и даже их маленькая энергия не помеха реакции: она протекает даже лучше, чем в синей области спектра;</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">5. Фотоны практически теряют свою энергию и их громадное количество уже не спасает.</span><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">В результате получаем почти классический график фотосинтеза:</span><br />\r\n<br />\r\n<img src="http://habrastorage.org/files/49c/607/158/49c6071581354c83ad0b24a9a12a6b7e.png" style="border:0px; color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px; line-height:20.7999992370605px; margin:0px; max-width:100%; outline:0px; padding:0px; vertical-align:middle" /><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">Из этого графика видно, что хлорофиллу гораздо выгоднее поглощать красные и синие цвета, чем цвета в середине спектра, которые дают растению слишком мало энергии. Поэтому хлорофиллы отражают его. А мы воспринимаем отраженный цвет как зеленый.</span><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">По сравнению с реальной физикой это достаточно упрощенное приближение, но все еще недостаточное для ребенка. Как же преобразовать это все в вариант 3? Зависит от вашей фантазии. Например:</span><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">Трава зеленая, потому что при таком цвете она может получать больше тепла от солнышка и лучше расти.</span><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">Этот ответ вообще не затрагивает хлорофилльско-фотосинтезирующие штуки. Но на мой взгляд, он вполне приемлем. Во-первых, он правдив. Во-вторых, поясняет именно причину, а не свойство каких-то там абстрактных хлорофиллов. Да, этот ответ подозрительно похож на вариант №2. Но он следует из вашего знания, которое вы упрощаете для детского разума. А не из вашего незнания, которое вы скрываете, чтобы ребенок не подумал, что вы&hellip;</span><br />\r\n<br />\r\n<em>&mdash; Пап, а почему небо голубое?</em><br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">&mdash; У тебя мороженко капает.</span><br />\r\n&nbsp;</p>\r\n\r\n<h4>Почему программисты крутые</h4>\r\n\r\n<p><br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">К чему это все? Из этого примера видно, что знание, которое иногда кажется нам наиболее приближенным к реальной картине вещей, не всегда является таковым. Как же люди понимают профессию программиста?</span></p>\r\n\r\n<blockquote>Если бы я хотел, то легко стал бы программистом</blockquote>\r\n\r\n<blockquote>Программисты ничего не делают</blockquote>\r\n\r\n<blockquote>Экономисты должны проделывать много расчетов, работать с кучей бумажек, и вообще &mdash; знали бы вы, как я устаю после рабочего дня...</blockquote>\r\n\r\n<p><br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">Я видел несколько дипломных работ экономистов. На то время я тоже писал диплом и легкие папочки по 20 страниц повергли меня в небольшое изумление, поскольку их содержимое было очень похоже на экономическую часть моего 100-страничного диплома. Знаете ли вы, что делает программист? Программист легко объяснит это. Другому программисту.</span><br />\r\n<br />\r\n<img src="http://habrastorage.org/files/e74/1e4/9ca/e741e49ca61b4134afaec64a143e0268.png" style="border:0px; color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px; line-height:20.7999992370605px; margin:0px; max-width:100%; outline:0px; padding:0px; vertical-align:middle" /><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">Я изобразил взгляд на проблему зеленой травы в виде следующего рисунка. Реальность &mdash; это бесконечное объяснение всех аспектов, от столкновений галактик до межъядерных взаимодействий. Ученый &mdash; это то, как этот вопрос пояснит эксперт в данной области. Человек &mdash; как эту ситуацию объяснит человек, просто знакомый с вопросом. И Ребенок &mdash; просто наблюдение явления.</span><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">Представим, что Ученый объясняет Ребенку, почему трава зеленая. Чтобы Ребенок это понял, разговор должен вестись в понятиях, знакомых Ребенку, и со значительной степенью упрощения. Если упрощение сделано верно, то при получении Ребенком дальнейших знаний они будут накладываться на имеющуюся картину, раскрывая отдельные понятия, а не замещая их абсолютно новыми. Хлорофиллы и фотосинтез дополняют начальную модель, а не изменяют ее.</span><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">Если мы спросим людей, кто такой программист, то получим целый спектр ответов: от &laquo;человека, который работает с компьютерами&raquo; до &laquo;такой бородатый страшный мужик в свитере со злыми глазами&raquo;;. Но скорее всего, самым популярным ответом будет &laquo;тот, кто пишет программы&raquo;. А что такое программа? С точки зрения программиста это набор инструкций для компьютера/другой машины/да чего угодно. Но с точки зрения непрограммиста, программа &mdash; это то, что запускается двойным щелчком мыши. Из разности этих взглядов вытекает любопытная мысль:</span><br />\r\n<br />\r\n<em>Программисты рисуют</em><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">Эта ложная предпосылка возникает у Ребенка, когда он впервые сталкивается с понятием программист. Потом это расширяется до &laquo;программисты рисуют игры&raquo;(</span><s>о боже мой, я хочу стать программистом и нарисовать батлфилд</s><span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">) и &laquo;программисты рисуют ворд и эксель&raquo;. Программисту, который является Ученым, сложно объяснить Человеку, чем он занимается, на языке Человека. Тем более если знания Человека основаны на неверной предпосылке Ребенка. Логика, которая является главной составляющей работы программиста, для обычных людей скрыта. Отсюда и мысль, что программирование &mdash; это не так уж сложно и этому можно научиться примерно за 21 день. Только тот, кто пробовал программировать и добился в этом успеха может знать степень сложности данной профессии.</span><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">А может ли программист знать, насколько сложна профессия экономиста? Да, может. Потому что он не только художник.</span><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">Какой должна быть правильная предпосылка? Которую понял бы ребенок и которая бы со временем превратилась бы в правильное осознание профессии программиста. Ребенок еще не знает понятия алгоритм, а если и знает &mdash; то не может расширить его на весь окружающий мир.</span><br />\r\n<br />\r\n<em>Программист &mdash; это тот, кто учит компьютер делать необходимые человеку вещи</em><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">И вот мы уже перешли от художника к учителю. Из этой предпосылки вполне может развиться &laquo;не только компьютер, но и другие механизмы с внутренним компьютером&raquo;, &laquo;компьютер сложнее учить, чем человека&raquo;, &laquo;компьютер думает не так, как человек&raquo;, &laquo;программист должен знать язык компьютера и понятно объяснить ему, что надо сделать&raquo;. И таким образом добавляем к художнику и учителю еще и переводчика. Добавим обязанность учиться новому, чтобы оставаться на плаву. Добавим переговоры с заказчиком. И вот у нас получился художник-учитель-переводчик-ученик-психолог.</span><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">А к этому всему добавляются все профессии, в которых используется компьютер. Если программист пишет программу для экономиста, он должен знать все аспекты работы экономиста. Он должен понять человека, который их объясняет, понять саму специфику работы, научить этому компьютер с помощью переведенной на компьютерный язык программы.&nbsp;</span><s>И поиграться со шрифтами.</s><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">Да, я считаю, что программист &mdash; сложная профессия. И разумеется, я не полностью объективен. Но я не хочу, чтобы человек боготворил программиста, жалел и уважал его. Или успокаивал себя на работе тем, что программисту работать сложнее. Я хочу, чтобы человек знал. И исходил в своих суждениях не из скрываемого незнания, а из упрощенного знания. Да, программист не должен знать все. Для написания программы для перевода не нужно знать все слова немецкого языка, чтобы считывать их переводы из базы данных. Но основы грамматики выучить придется. Программист должен подстраиваться под окружающие его проекты, непрерывно получая новые знания и обучая этому глупый компьютер.</span><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">Поэтому программисты крутые.</span><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">P.S.: Целью данной статьи не является оскорбление экономистов.</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:verdana,sans-serif; font-size:12.8000001907349px">P.P.S.: Мнение автора статьи полностью не совпадает с мнением профессора бухгалтерского учета. Просто чтобы вы знали.</span></p>\r\n	Сергей	186a22f1db0e4533b572635ad33558bb.jpg	2014-09-18 06:29:06.637693	2014-11-29 23:37:19.43552	138		jukov_jukov_inter.jpg	t	f	2
10	Немного о международных экзаменах	<p dir="ltr"><span style="font-size:16px"><span style="font-family:trebuchet ms,helvetica,sans-serif"><span style="background-color:transparent; color:rgb(0, 0, 0)">Система тестирования, разработанная Кембриджским университетом, давно завоевала международное признание. Результаты экзаменов KET, PET, FCE, CEA, CPE признаются учебными заведениями и работодателями во всем мире, Кембриджский сертификат &ndash; Ваш пропуск в мир без языковых границ.</span></span></span></p>\r\n\r\n<p dir="ltr"><span style="background-color:transparent; color:rgb(0, 0, 0); font-family:trebuchet ms,helvetica,sans-serif; font-size:16px">Самыми востребоваными сертификатами являются IELTS и TOEFL. Получение этих сертификатов требует уровня владения языком, превышающего средний. Однако, даже будучи уверенным в своих знаниях, не мешает пройти специальную подготовку. Знать язык и уметь сдавать конкретный экзамен &ndash; это не одно и то же. Наши преподаватели не только ликвидируют возможные пробелы в знаниях, но и ознакомят с формальными требованиями, научат оптимально распределять время на экзамене и отработают до автоматизма навык распознавания типа задания, благодаря чему у Вас появится резервное время для его выполнения.</span></p>\r\n\r\n<p><strong>КЕТ</strong><span style="background-color:transparent; color:rgb(0, 0, 0); font-family:trebuchet ms,helvetica,sans-serif; font-size:16px"> и </span><strong>РЕТ</strong><span style="background-color:transparent; color:rgb(0, 0, 0); font-family:trebuchet ms,helvetica,sans-serif; font-size:16px"> &ndash; это экзамены, подтверждающие владение языком на уровнях Elementary &ndash; Pre-Intermediate (A2) &nbsp;и Pre-Intermediate &ndash; Intermediate (B1) соответственно. Чаще всего их сдают школьники. Если Вы планируете обучение своего ребенка за границей, ему необходимо будет подтвердить знание английского языка. Наличие Кембриджского сертификата будет существенным преимуществом.</span></p>\r\n\r\n<p><span style="background-color:transparent; color:rgb(0, 0, 0); font-family:trebuchet ms,helvetica,sans-serif; font-size:16px">На наших занятиях, постоянно выполняя задания в формате теста, ученики приобретут устойчивый навык. Это до минимума снизит стресс от экзаменационной обстановки и сэкономит время, необходимое для понимания сути задания.</span></p>\r\n\r\n<p dir="ltr">&nbsp;</p>\r\n\r\n<p dir="ltr"><span style="font-size:16px"><span style="font-family:trebuchet ms,helvetica,sans-serif"><strong>Самые распространенные экзамены &ndash; FCE, IELTS и TOEFL.</strong></span></span></p>\r\n\r\n<p dir="ltr"><strong>FCE</strong><span style="background-color:transparent; color:rgb(0, 0, 0); font-family:trebuchet ms,helvetica,sans-serif; font-size:16px"> &ndash; </span><strong>First Certificate in English</strong><span style="background-color:transparent; color:rgb(0, 0, 0); font-family:trebuchet ms,helvetica,sans-serif; font-size:16px">, удостоверяет знание английского языка на уровне Upper Intermediate. Этот уровень предполагает, что изучающий язык имеет хорошую языковую подготовку и может эффективно использовать английский язык при работе, не имеющей узкопрофессиональной специфики.</span></p>\r\n\r\n<p dir="ltr"><strong>Экзамен состоит из 5 частей:</strong></p>\r\n\r\n<p dir="ltr"><span style="font-size:16px"><span style="font-family:trebuchet ms,helvetica,sans-serif"><span style="background-color:transparent; color:rgb(0, 0, 0)">- Чтение</span></span></span></p>\r\n\r\n<p dir="ltr"><span style="font-size:16px"><span style="font-family:trebuchet ms,helvetica,sans-serif"><span style="background-color:transparent; color:rgb(0, 0, 0)">- Письмо</span></span></span></p>\r\n\r\n<p dir="ltr"><span style="font-size:16px"><span style="font-family:trebuchet ms,helvetica,sans-serif"><span style="background-color:transparent; color:rgb(0, 0, 0)">- Восприятие на слух</span></span></span></p>\r\n\r\n<p dir="ltr"><span style="font-size:16px"><span style="font-family:trebuchet ms,helvetica,sans-serif"><span style="background-color:transparent; color:rgb(0, 0, 0)">- Разговор</span></span></span></p>\r\n\r\n<p dir="ltr"><span style="font-size:16px"><span style="font-family:trebuchet ms,helvetica,sans-serif"><span style="background-color:transparent; color:rgb(0, 0, 0)">- Использование английского языка ( письменные упражнения, в которых проверяется знание грамматики, устойчивых словосочетаний, словарный запас).</span></span></span></p>\r\n\r\n<p><span style="background-color:transparent; color:rgb(0, 0, 0); font-family:trebuchet ms,helvetica,sans-serif; font-size:16px">Сертификат выдается тем, кто получил оценки А, В и С. Оценки D и E считаются неудовлетворительными.</span></p>\r\n\r\n<p><span style="background-color:transparent; color:rgb(0, 0, 0); font-family:trebuchet ms,helvetica,sans-serif; font-size:16px">FCE, как и все Кембриджские экзамены, действителен неограниченное время, тогда как результаты IELTS и TOEFL необходимо подтверждать каждые два года. Поэтому, если Ваш будущий работодатель или учебное заведение принимает результаты Кембриджских экзаменов, разумнее сдавать именно их.</span></p>\r\n\r\n<p dir="ltr"><span style="background-color:transparent; color:rgb(0, 0, 0); font-family:trebuchet ms,helvetica,sans-serif; font-size:16px">Экзамены </span><strong>САЕ</strong><span style="background-color:transparent; color:rgb(0, 0, 0); font-family:trebuchet ms,helvetica,sans-serif; font-size:16px"> ( Certificate of Advanced English) и </span><strong>СРЕ </strong><span style="background-color:transparent; color:rgb(0, 0, 0); font-family:trebuchet ms,helvetica,sans-serif; font-size:16px">(Ceritificate of Proficiency in English) имеют ту же структуру и систему оценки, что и FCE, но предъявляют более жесткие требования к знанию грамматики, словарному запасу, скорости и связности &nbsp;речи.</span></p>\r\n\r\n<p><strong>САЕ </strong><span style="background-color:transparent; color:rgb(0, 0, 0); font-family:trebuchet ms,helvetica,sans-serif; font-size:16px">рассматривается как свидетельство способности кандидата завершить высшее образование в Великобритании и других странах Европы, жить и работать в этих странах, </span><strong>СРЕ &ndash; </strong><span style="background-color:transparent; color:rgb(0, 0, 0); font-family:trebuchet ms,helvetica,sans-serif; font-size:16px">свидетельство профессионального владения языком. Получение высшего балла на этом экзамене предполагает, что Ваша речь практически неотличима от речи образованного носителя английского языка. Это престижный сертификат, очень немногие работодатели и учебные заведения требуют столь высокого уровня.</span></p>\r\n\r\n<p dir="ltr"><strong>IELTS &ndash; International English Language System,</strong><span style="background-color:transparent; color:rgb(0, 0, 0); font-family:trebuchet ms,helvetica,sans-serif; font-size:16px"> является самым востребованным сертификатом в мире. Для этого есть объективные причины. Прежде всего, этот экзамен теоретически невозможно &laquo;завалить&raquo;. По результатам тестируемый получает баллы от 1 до 9. Учебные заведения и работодатели, как правило, требуют результат от 6,5 до 7,5, однако в каждом конкретном случае эту информацию необходимо уточнять. Другая причина, по которой IELTS столь распространен, состоит &nbsp;в том, что только он дает право выбора модуля: академический или общий, в зависимости от цели кандидата.</span></p>\r\n\r\n<p dir="ltr"><span style="background-color:transparent; color:rgb(0, 0, 0); font-family:trebuchet ms,helvetica,sans-serif; font-size:16px">Экзамен проверяет четыре составных части владения языком: умение говорить, понимать речь на слух, писать и читать. Соответственно, состоит он из 4 частей, каждая из которых оценивается отдельно. Из 4 оценок выводится средняя, которая и является окончательным баллом. Так, если Вы не слишком хорошо пишете, но уверенно говорите и хорошо понимаете чужую речь, как устную, так и письменную, у Вас есть шансы на высокий балл: (8.5+7,5+8+4):4=7 &nbsp; &nbsp;&nbsp;</span></p>\r\n\r\n<p dir="ltr"><strong>TOEFL &ndash; Test of English as a Foreign Language. </strong><span style="background-color:transparent; color:rgb(0, 0, 0); font-family:trebuchet ms,helvetica,sans-serif; font-size:16px">Это</span><strong> </strong><span style="background-color:transparent; color:rgb(0, 0, 0); font-family:trebuchet ms,helvetica,sans-serif; font-size:16px">американский экзамен, подготовленный в Educational Testing Service, Пристонский университет, США. Для его успешной сдачи необходимо знать различия английского и американского написания некоторых слов, словоупотребления и идиоматики. Предоставление результатов TOEFL является необходимым условием поступления вузы США и Канады, а также для обучения по программе МВА.</span></p>\r\n\r\n<p dir="ltr"><span style="font-size:16px"><span style="font-family:trebuchet ms,helvetica,sans-serif"><span style="background-color:transparent; color:rgb(0, 0, 0)">В России существует два варианта этого экзамена: РВТ &ndash; &ldquo;бумажный&rdquo; (Paper-Based Test) и iBT - &ldquo;электронный&rdquo; (Internet-Based Test). IBT считается более предпочтительным, так как проверяет навыки устной речи, наравне с письмом, чтением и пониманием устной речи.</span></span></span></p>\r\n\r\n<p><span style="font-size:16px"><span style="font-family:trebuchet ms,helvetica,sans-serif"><span style="background-color:transparent; color:rgb(0, 0, 0)">Экзамен длится около 4 часов и состоит из четырех частей. Максимальное количество баллов 120 (по 30 на каждую часть). Для поступления на программу бакалавриата обычно требуется 60-90 баллов, для получения постдипломного образования &ndash; 70-100 баллов.</span></span></span></p>\r\n	Polina Dubershtein	bf732f28226468e114b11b4a06498509.jpg	2014-11-09 09:27:34.639926	2014-12-02 16:59:38.085399	45	Методист команды TreeWords	6237bf936882961e291cd65df91d1aec.jpg	f	t	2
\.
