3	ДЛЯ МОЛОДЫХ СПЕЦИАЛИСТОВ	Если Вы студент или выпускник ВУЗа, не упустите свой шанс: принять участие в уникальном инновационном проекте; получить интересный практический опыт; а также подготовить по-настоящему значимую научную работу, которая точно получит высокую оценку специалистов.	2014-11-09 13:48:05.752045	2014-11-09 17:42:10.537455	2	1		<h1><strong>Не упустите свой шанс:</strong></h1>\r\n\r\n<ul>\r\n\t<li>\r\n\t<p>Принять участие в уникальном инновационном проекте</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Получить интересный практический опыт</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Подготовить по-настоящему значимую научную работу, которая точно получит высокую оценку специалистов</p>\r\n\t</li>\r\n</ul>\r\n\r\n<p><strong>От интересного проекта к перспективной карьере!</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h1><strong>А что взамен?</strong></h1>\r\n\r\n<ul>\r\n\t<li>\r\n\t<p>Наша инновационная идея</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Обеспечение материалами для написания вашей работы</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Поддержка и необходимые экспертные заключения по теме</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Увлекательная работа, оставляющая возможность для творчества и самореализации</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Тренинги и семинары на актуальные темы</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Сплоченная команда друзей и единомышленников</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Уникальные возможности для карьерного роста</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Возможность общения с коллегами и студентами из разных стран</p>\r\n\t</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h1><strong>Требования:</strong></h1>\r\n\r\n<ul>\r\n\t<li>\r\n\t<p>Студенты последних курсов и аспиранты педагогических и лингвистических вузов</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Уровень владения английским языком не ниже Advanced и отличное произношение</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Владение современными методиками и инновационными технологиями в обучении</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Опыт участия в проектной деятельности приветствуется</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Глобальное мышление и структурированный подход к решению вопросов, умение выставлять приоритеты</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Сильные коммуникативные навыки, харизматичность, проактивность, креативность, клиентоориентированность</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Владение ПК &ndash; MS Office, Internet, Skype, платформы дистанционного обучения</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Опыт проживания в англоязычной стране</p>\r\n\t</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h1><strong>Должностные обязанности:</strong></h1>\r\n\r\n<ul>\r\n\t<li>\r\n\t<p>Выстраивание процесса обучения (разработка карт процессов, рабочих инструкций, систем оценки качества обучения и т.д.)</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Мониторинг и анализ существующих на рынке программ и современных технологий обучения</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Разработка образовательных программ и выбор наиболее оптимальных методик, нацеленных на обучение в режиме онлайн</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Подбор/разработка&nbsp;материалов для каждой программы</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Участие в процессе отбора персонала</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Проведение интервью с клиентами, определение их потребностей в обучении и уровня их знаний</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Разработка тренингов для персонала компании</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Участие в процессе развития бизнеса и различных маркетинговых мероприятиях</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Консультирование клиентов по продуктам и услугам компании</p>\r\n\t</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h1><strong>Мы предлагаем:</strong></h1>\r\n\r\n<ul>\r\n\t<li>\r\n\t<p>Заработная плата по результатам собеседования</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Удаленная работа</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Гибкий график</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Возможность профессионального развития</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Обучение, тренинги, семинары</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Работа в многонациональной среде, общение с носителями языка</p>\r\n\t</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n
